package com.day2;

public class LogicalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=20,b=30;
		if(a>=b && a<=b) {
			System.out.println("A is greater");
		}
		 if(b>=a || a<=b) {
			System.out.println("B is greater");
		}
		if(a!=b) {
			System.out.println("It is not equal");
		}

	}

}
